import React from 'react';

const Navbar = ({ toggleDarkMode, darkMode }) => {
  return (
    <nav className="bg-gray-800 text-white p-4 fixed w-full z-10">
      <div className="flex justify-between items-center">
        <div className="flex items-center space-x-4">
          <img src="/assets/images/NavLogo.jpg" alt="Logo" className="h-8" />
          <span className="text-xl font-bold">John Doe</span>
        </div>

        <div className="flex items-center space-x-6">
          <a href="#about" className="hover:text-gray-400">About</a>
          <a href="#projects" className="hover:text-gray-400">Projects</a>
          <a href="#contact" className="hover:text-gray-400">Contact</a>

          {/* Social Media Links */}
          <a href="https://github.com/johndoe" target="_blank" rel="noopener noreferrer">
            <i className="fab fa-github text-2xl hover:text-gray-400"></i>
          </a>
          <a href="https://linkedin.com/in/johndoe" target="_blank" rel="noopener noreferrer">
            <i className="fab fa-linkedin text-2xl hover:text-gray-400"></i>
          </a>

          {/* Dark Mode Toggle */}
          <button
            onClick={toggleDarkMode}
            className="bg-gray-600 p-2 rounded-full focus:outline-none"
          >
            {darkMode ? (
              <i className="fas fa-sun text-yellow-400"></i>
            ) : (
              <i className="fas fa-moon text-gray-200"></i>
            )}
          </button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
